//                  MAKING FRONT-END DEVELOPER LIST PROFILE'S COMPONENT                 \\

    // Importing Requried Modules :
import React from 'react';

    // Importing Requried Component :
import Pro from './Profile';

    // Importing Array that contain all Profiles Data :
import ProfileData from "./ProfileData";

function Front() {
    return (
        <>
            <Pro
                proname={ProfileData[0].proname}
                proimg={ProfileData[0].proimg}
                prolink={ProfileData[0].prolink}
                proexpert={ProfileData[0].proexpert}
            />
            <Pro
                proname={ProfileData[1].proname}
                proimg={ProfileData[1].proimg}
                prolink={ProfileData[1].prolink}
                proexpert={ProfileData[1].proexpert}
            />
            <Pro
                proname={ProfileData[4].proname}
                proimg={ProfileData[4].proimg}
                prolink={ProfileData[4].prolink}
                proexpert={ProfileData[4].proexpert}
            />
        </>
    )
};


    // Exporting Component :
export default Front;
